mapper.select:

select 

from RMINFISCDATA
where RMINFISCDATA_TXDATE = #{rminfiscdataTxdate,jdbcType=CHAR}
  and RMINFISCDATA_FISCSNO = #{rminfiscdataFiscsno,jdbcType=CHAR}

mapper.delete:

delete from RMINFISCDATA
where RMINFISCDATA_TXDATE = #{rminfiscdataTxdate,jdbcType=CHAR}
  and RMINFISCDATA_FISCSNO = #{rminfiscdataFiscsno,jdbcType=CHAR}
